import React from 'react';
import './AddressInfo '

function AddressInfo() {
  return (
    <section id="address-section">
      <h2>Our Location</h2>
      <div className="address-info">
        <p><strong>Company Name:</strong> Your Company Name</p>
        <p><strong>Address:</strong> 123 Main Street</p>
        <p><strong>City:</strong> Your City</p>
        <p><strong>State/Region:</strong> Your State/Region</p>
        <p><strong>Postal Code:</strong> ZIP Code</p>
        <p><strong>Country:</strong> Your Country</p>
      </div>
      <div className="map-container">
        {/* Embed a map here (Google Maps, OpenStreetMap, etc.) */}
        <iframe src="https://www.google.com/maps/embed?params=your-location" width="100%" height="300" frameBorder="0" style={{ border: 0 }} allowFullScreen title="Map"></iframe>
      </div>
      <div className="map-links">
        <a href="https://maps.google.com/?q=123+Main+Street+YourCity" target="_blank" rel="noopener noreferrer">Open in Google Maps</a>
      </div>
    </section>
  );
}

export default AddressInfo;
